import React from 'react';
import {Switch} from 'react-router-dom';
import {Route} from 'react-router-dom';
import {Contact} from './components'
import './App.css';

function App() {
  return (

    <Router>
    <div className="App">



                    <Switch>

                      <Route path="/Contact">
                        <Contact />
                      </Route>


                    </Switch>



    </div>
  </Router>
  );
}

export default App;
